import React from 'react';
import { NavLink } from 'react-router-dom';

const Menu = () => {
    return (
        <>
            <div className="nav_bar">
                <ul>
                    <li>
                        <NavLink exact activeClassName="nav_class"  to="/">About</NavLink>
                    </li>
                    <li>
                        <NavLink exact activeClassName="nav_class" to="/Service">Services</NavLink>
                    </li>
                    <li>
                        <NavLink exact activeClassName="nav_class"   to="/Contact">Contact</NavLink>
                    </li>
                </ul>
            </div>
        </>
    )
}

export default Menu;
